 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff6600;font-size:37px;\"><B>Lab Komputer</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;\">Tempat ini dinamakan Lab Komputer, pada lab ini berisi banyak sekali komputer yang biasa dipakai siswa dan siswi untuk melakukan praktikum pada mata pelajaran \"Teknologi Informasi dan Komunikasi\" atau \"Teknik Komputer dan Jaringan\". Komputer yang ada di ruangan ini juga bisa digunakan untuk keperluan ujian sekolah ataupun ujian nasional dengan berbasis online.</SPAN></SPAN></DIV></div>",
